  04> HUTTON, Robert Clayton m on 05.05.1951 to TAKIARI, Atarua (Topsy)
  b 12.11.1927
  b 10.06.1931 d 23.11.1987
  Robert b. at Pahiatua and m, at St Bride's Church, Otorohanga. Atarua, d/o Tautoko Takiari and Hana
  Hua, b. at Rakaunui, Kawhia, d. at Wellington and bd. at Otorohanga. She is of Ngati-te-Waha and
  Ngati-te-Kiriwai subtribes of Waikato and Maniapoto. Address: Ellis Road, Kio Kio, RD 4, Otorohanga.
  Topsy and Robert are registered psychiatric nurses. They trained and worked at Tokanui hospital from
  1950 to 1958. They then bought a dairy farm at Uruti, Taranaki and later another one at Purangi.
  Besides farming, Robert worked as a butcher and Topsy as a psychiatric social worker for the Taranaki
  Area Health Board. They are now retired on an urban farmlet in New Plymouth.
